import React, {Component} from "react";

class ShoppingCartObject extends Component {

    render() {

        return (
            <div className="shoppingCartObject">
                <div className="row">
                    <div className="col-3 mt-2">
                    </div>
                    <div className="col-5 mt-2 text-center">
                        <p className="m-2">{this.props.shoppingCartObject.name}</p>
                    </div>
                    <div className="col-4 mt-2">
                        <p className="text-nowrap">
                            <button className="btn btn-outline-dark btn-sm m-2">+</button>
                            {this.props.shoppingCartObject.quantity}
                            <button className="btn btn-outline-dark btn-sm m-2">-</button>
                        </p>
                    </div>
                </div>
                <hr/>
            </div>
        );
    }
}

export default ShoppingCartObject
